import React from 'react'
import classes from './PlaylistItem.module.css'

const PlayedItem = ({ currentPlayed, playlistItem, click, key }) => {
	console.log()
	return (
		<li
			className={
				currentPlayed === key
					? classes.playListItemActive
					: classes.playListItem
			}
		>
			<div onClick={() => click(playlistItem)}>
				<h1>{playlistItem.title}</h1>
				<p>{playlistItem.url}</p>
			</div>
		</li>
	)
}

export default PlayedItem
